import React from "react";
import {Link} from 'react-router-dom';
import M from 'materialize-css';

const NavBar = () => {

	document.addEventListener('DOMContentLoaded', function() {
	    var elems = document.querySelectorAll('.sidenav');
	    var instances = M.Sidenav.init(elems, {});
  	});

	return (
		<div style={{top:"10px", position:"fixed", width:"100%"}}>
			<nav class="">
				<div class="logo" id="logo">
				   <h1>
						<a class="navbar-brand" href="index.html"><img src="https://rrsecurityservices.com/images/logo.png" width="90" class="mr-4"/>Royal Rajputana Security</a>
					</h1>
				</div>
				<label for="drop" class="toggle"><span class="fa fa-bars"></span></label>
                <input type="checkbox" id="drop"/>
		 		<ul class="menu mmmt">
                    <li class="mr-lg-4 mr-3 active"><a href="index.html">Home</a></li>
					<li class="mr-lg-4 mr-3"><a href="about.html">About</a></li>
                    <li class="mr-lg-4 mr-3"><a href="services.html">Services</a></li>
					<li class="mr-lg-4 mr-3"><a href="gallery.html">Gallery</a></li>
                    <li><a href="contact.html">Contact</a></li>
		        </ul>
		    </nav>
		</div>
	);
};


export default NavBar;
